import Container from "../components/general_components/Container";

const estilo = {
  height: "100%",
  margin: 0,
  font: `400 15px/1.8 "Lato", sans-serif`,
  color: "#777",
};

const ScreenSaver = () => {
  return (
    <>
      <Container title="Background" style={estilo}>
        <div
          className="bgimg-1"
          style={{ backgroundImage: "url(https://source.unsplash.com/random)" }}
        >
          <div className="caption">
            <span className="border">FULL PAGE</span>
            <br />
            <span className="border">BACKGROUND IMAGE</span>
          </div>
        </div>
      </Container>
    </>
  );
};

export default ScreenSaver;
